import React from "react";
import { Link } from "react-router-dom";

const servicesImgBlock = ({ link, title, imgSrc, text }) => {
  return (
    <li className=''>
      <Link to={link}>
        <h2>{title}</h2>
        <img src={imgSrc} alt={title} className='' />
        <p className=''>{text}</p>
      </Link>
    </li>
  );
};

export default servicesImgBlock;
